import Carousel from 'react-bootstrap/Carousel';
import Button from 'react-bootstrap/Button';


function CarCarrousel({ vehiculos }) {

    /*
    Constante que almacena un nuevo array con la lista de vehiculos a partir de un map
    */
    const listCar = vehiculos.map(
        element =>
            <CarComponent vehiculo={element} />

    );

    const prueba = vehiculos.map(
        element =>
            <Carousel>
                <Carousel.Item>
                    <img
                        className="d-block w-50"
                        src="{vehiculo.img}"
                        alt="First slide"
                    />
                    <Carousel.Caption>
                        <h3>element}</h3>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-50"
                        src="{vehiculo.img}"
                        alt="First slide"
                    />
                    <Carousel.Caption>
                    <h3>hola</h3>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
    );


    return (
        <>
            <Button variant="primary">Primary</Button>{' '}

            {prueba}
        </>


    );
}

export default CarCarrousel;
